import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import backendURL from '../apiConfig';

export default function ProfilePage() {
  const [user, setUser] = useState(null);
  const [locations, setLocations] = useState([]);
  const [savedLocations, setSavedLocations] = useState([]);
  const [reviews, setReviews] = useState([]);
  const [averageRatings, setAverageRatings] = useState({});
  const [savedAverageRatings, setSavedAverageRatings] = useState({});
  const [error, setError] = useState('');

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      const parsedUser = JSON.parse(storedUser);
      setUser(parsedUser);

      // Fetch all locations
      axios.get(`${backendURL}/api/locations`)
        .then(locRes => {
          const allLocations = locRes.data;

          // User's own locations
          const userLocations = allLocations.filter(location => location.username === parsedUser.username);
          setLocations(userLocations);

          // Fetch all reviews for averages
          axios.get(`${backendURL}/api/reviews`)
            .then(revRes => {
              const reviews = revRes.data;

              const ratingsMap = {};
              const savedRatingsMap = {};

              userLocations.forEach((loc) => {
                const locationReviews = reviews.filter(r => r.locationId === loc._id);
                if (locationReviews.length > 0) {
                  const total = locationReviews.reduce((sum, r) => sum + r.rating, 0);
                  ratingsMap[loc._id] = total / locationReviews.length;
                } else {
                  ratingsMap[loc._id] = null;
                }
              });

              setAverageRatings(ratingsMap);

              // Handle saved locations
              if (parsedUser.savedLocations && parsedUser.savedLocations.length > 0) {
                const savedLocs = allLocations.filter(loc => parsedUser.savedLocations.includes(loc._id));
                setSavedLocations(savedLocs);

                savedLocs.forEach((loc) => {
                  const locationReviews = reviews.filter(r => r.locationId === loc._id);
                  if (locationReviews.length > 0) {
                    const total = locationReviews.reduce((sum, r) => sum + r.rating, 0);
                    savedRatingsMap[loc._id] = total / locationReviews.length;
                  } else {
                    savedRatingsMap[loc._id] = null;
                  }
                });

                setSavedAverageRatings(savedRatingsMap);
              }
            })
            .catch(err => console.error('Error fetching reviews:', err));
        })
        .catch(err => {
          console.error('Error fetching locations:', err);
          setError('Failed to load locations.');
        });

      // Fetch user's own reviews
      axios.get(`${backendURL}/api/reviews`)
        .then(res => {
          const userReviews = res.data.filter(review => review.username === parsedUser.username);
          setReviews(userReviews);
        })
        .catch(err => console.error('Error fetching reviews:', err));
    }
  }, []);

  const renderStars = (rating) => {
    const stars = [];
    const rounded = Math.round(rating);
    for (let i = 0; i < 5; i++) {
      if (i < rounded) {
        stars.push(<span key={i} className="text-hunter text-xl">★</span>);
      } else {
        stars.push(<span key={i} className="text-hunter text-xl">☆</span>);
      }
    }
    return stars;
  };

  return (
    <div className="min-h-screen pt-20 px-4 flex flex-col items-center bg-inherit font-inknut text-brunswick">
      {/* My Locations */}
      <h1 className="text-4xl font-bold mb-8">My Locations</h1>

      {error && <p className="text-imperial mb-6">{error}</p>}

      {locations.length > 0 ? (
        <div className="w-full max-w-6xl overflow-x-auto">
          <div className="flex space-x-6 py-4">
            {locations.map((location) => (
              <div key={location._id} className="flex-shrink-0 w-80 bg-alabaster rounded-lg shadow-md p-6 mr-6 transform hover:scale-105 transition duration-300 ease-in-out">
                <Link to={`/locations/${location._id}`}>
                  <h2 className="text-2xl font-bold text-fern hover:text-hunter mb-2 text-center">{location.locationName}</h2>
                  <div className="flex justify-center items-center mb-4">
                    {averageRatings[location._id] !== undefined && averageRatings[location._id] !== null ? (
                      renderStars(averageRatings[location._id])
                    ) : (
                      <p className="italic text-hunter text-sm">Not yet rated</p>
                    )}
                  </div>
                </Link>
                <p className="text-sm text-center mb-1"><strong>Type:</strong> {location.locationType}</p>
                <p className="text-sm text-center mb-1"><strong>Address:</strong> {location.address}</p>
                <p className="text-sm text-center">{location.description}</p>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <p>No locations created yet.</p>
      )}

      {/* My Reviews */}
      <h1 className="text-4xl font-bold my-12">My Reviews</h1>

      {reviews.length > 0 ? (
        <div className="w-full max-w-6xl overflow-x-auto">
          <div className="flex space-x-6 py-4">
            {reviews.map((review) => (
              <div key={review._id} className="flex-shrink-0 w-80 bg-alabaster rounded-lg shadow-md p-6 mr-6 transform hover:scale-105 transition duration-300 ease-in-out">
                <Link to={`/locations/${review.locationId}`}>
                  <h2 className="text-2xl font-bold text-fern hover:text-hunter mb-2 text-center">{review.locationName}</h2>
                  <div className="flex justify-center items-center mb-4">
                    {renderStars(review.rating)}
                  </div>
                </Link>
                <p className="text-sm text-center">{review.description}</p>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <p>No reviews submitted yet.</p>
      )}

      {/* Saved Locations */}
      <h1 className="text-4xl font-bold my-12">Saved Locations</h1>

      {savedLocations.length > 0 ? (
        <div className="w-full max-w-6xl overflow-x-auto">
          <div className="flex space-x-6 py-4">
            {savedLocations.map((location) => (
              <div key={location._id} className="flex-shrink-0 w-80 bg-alabaster rounded-lg shadow-md p-6 mr-6 transform hover:scale-105 transition duration-300 ease-in-out">
                <Link to={`/locations/${location._id}`}>
                  <h2 className="text-2xl font-bold text-fern hover:text-hunter mb-2 text-center">{location.locationName}</h2>
                  <div className="flex justify-center items-center mb-4">
                    {savedAverageRatings[location._id] !== undefined && savedAverageRatings[location._id] !== null ? (
                      renderStars(savedAverageRatings[location._id])
                    ) : (
                      <p className="italic text-hunter text-sm">Not yet rated</p>
                    )}
                  </div>
                </Link>
                <p className="text-sm text-center mb-1"><strong>Type:</strong> {location.locationType}</p>
                <p className="text-sm text-center mb-1"><strong>Address:</strong> {location.address}</p>
                <p className="text-sm text-center">{location.description}</p>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <p>No saved locations yet.</p>
      )}
    </div>
  );
}
